export const weatherList = [
  {
    weather_id: 1,
    weather_img: process.env.PUBLIC_URL + `/assets/darkSun.png`,
    weather_descript: "Sunny",
  },
  {
    weather_id: 2,
    weather_img: process.env.PUBLIC_URL + `/assets/darkWindy.png`,
    weather_descript: "Windy",
  },
  {
    weather_id: 3,
    weather_img: process.env.PUBLIC_URL + `/assets/darkCloudy.png`,
    weather_descript: "Cloudy",
  },
  {
    weather_id: 4,
    weather_img: process.env.PUBLIC_URL + `/assets/darkRainy.png`,
    weather_descript: "Rainy",
  },
  {
    weather_id: 5,
    weather_img: process.env.PUBLIC_URL + `/assets/darkSnowy.png`,
    weather_descript: "Snowy",
  },
];
